import "../../assets/components_css/main.css";

const Card = ({ nftImg }) => {
  const [nftA1, nftA2, nftA3, ui_A, pages] = nftImg;
  return (
    <div className="card">
      <img src={nftA1} alt="" style={{ maxWidth: "100%", maxHeight: "" }} />
      <div style={{ display: "flex", gap: "1.5rem" }}>
        <img src={nftA2} alt="" />
        <img src={nftA3} alt="" />
        <p>{pages}+</p>
      </div>
    </div>
  );
};

export default Card;
